import { Plus } from "lucide-react";
import { Link } from "react-router-dom";

const Card = ({
  title,
  author,
  duration,
}: {
  title: string;
  author: string;
  duration: string;
}) => (
  <div className="bg-white rounded-lg shadow-md overflow-hidden">
    <div className="w-full h-48 bg-black"></div>
    <div className="p-4">
      <h3 className="text-lg font-medium mb-2">{title}</h3>
      <p className="text-gray-500 text-sm">
        {author}
        <div className="flex justify-end">
          <span>{duration}</span>
        </div>
      </p>
    </div>
  </div>
);
const Dashboard = () => {
  const Cards = [
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
  ];

  return (
    <>
      <div className="flex border">
        <div className="m-4 ml-8">
          <h1 className="text-2xl font-bold ">대시보드</h1>
        </div>
      </div>
      <div className="flex min-h-screen">
        <div className="w-1/4  p-4">
          <div className="flex justify-center items-center mt-10">
            <div className="w-52 h-52 bg-gray-100 rounded-lg border border-gray-200 flex justify-center items-center mb-10">
              <img
                src=""
                alt="profile"
                className="w-full h-full object-cover rounded-lg"
              />
            </div>
          </div>
          <div className="flex flex-col items-center justify-center space-y-4">
            <Link to="" className="cursor-pointer hover:text-gray-600">
              내 채팅 기록
            </Link>
            <Link to="" className="cursor-pointer hover:text-gray-600">
              계정 설정
            </Link>
            <Link to="" className="cursor-pointer hover:text-gray-600">
              로그아웃
            </Link>
          </div>
        </div>

        <div className="flex-1 bg-green-50 p-8">
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {Cards.map((video, index) => (
              <Card
                key={index}
                title={video.title}
                author={video.author}
                duration={video.duration}
              />
            ))}
          </div>

          <button className="fixed bottom-8 right-8 bg-green-700 text-white rounded-full p-4 shadow-lg hover:bg-green-800 transition-colors">
            <div className="flex items-center justify-center">
              <Plus className="w-6 h-6" />
              <span className="ml-2">새 채팅 시작하기</span>
            </div>
          </button>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
